'''Democracia Liberal''' ou só '''Liberalismo''' encurtado para '''LibDem'' e '''Lib'' respectivamente, é uma ideologia centrista, culturalmente de esquerda, que é conhecida por ser a ideologia que domina "o mundo ocidental"(Europa, As Américas, Oceania)
O que separa liberalismo do clássico liberalismo, é a ênfase que o primeiro tem em justiça e igualdade social comparado com seus predecessores.

