O stalinismo é uma ideologia totalitária, economicamente de extrema esquerda, que habita o canto superior esquerdo da bússola política. O stalinismo é considerado culturalmente conservador pelos detratores por causa de sua oposição aos direitos LGBT, elogios aos papéis tradicionais de gênero e breve renascimento da Igreja Ortodoxa Russa. Alguns adeptos e detratores do stalinismo contestam isso com as condições materiais e sua ideologia ateísta. Ele só trouxe de volta as igrejas ortodoxas porque muitos cidadãos soviéticos permaneceram secretamente religiosos (o que não era diretamente proibido), então a “legalização” da Ortodoxia ajudou a manter a nação na guerra unida - uma coisa crucial. Em segundo lugar, os Aliados pressionavam Stalin no sentido de afrouxar o controle sobre os religiosos: a opressão dos fiéis era má publicidade.
Ele acredita na rápida industrialização Indust.png, produção socialista de mercadorias, Soc.png Socialism Isolationist.png em um país Isolation.png, um Estado totalitário Totalitarian.png, coletivização da agricultura, culto da personalidade.

