Soulismo, anteriormente conhecido como Ego-Communalism, é um Offcompass.png off-the-compass Libleft.png Ideologia de esquerda libertária que acredita que um indivíduo deve ser capaz de fazer qualquer coisa que desejar, resultando em todos compartilhando todas as suas propriedades (ambos privados e pessoal) com todos os outros porque é do interesse de todos compartilhar. Além disso, o Soulismo acredita que não apenas as hierarquias de estado, capital e reação devem ser abolidas, mas também hierarquias como a gravidade ou a inércia. O Soulism acredita que isso seja possível pela ascensão a um nível superior de ser ou tecnologia transhumanista.
O soulismo acredita que o indivíduo é tudo e seu ego é a alma, e seus desejos por preguiça, lazer, drogas, etc. devem ser satisfeitos para que uma sociedade verdadeiramente sã seja alcançada e isso só pode acontecer por meio da anarquia.

