O anarcototalitarismo preso ao AnTot é uma bola que representa a "unidade oposta" dos dois extremos do espectro cívico e, portanto, o AnTot é o filho profano de Awaj.png Anarquismo e Totalitarismo.png Totalitarismo. Na usual unidade oposta, seus pontos de vista compreendem principalmente as coisas sobre as quais totalitaristas e anarquistas concordam, como "Abolir hierarquias injustificadas" e formas nas quais anarquistas e totalitários são semelhantes, como o uso da violência.
Também existe uma concepção de que o anarco-totalitarismo poderia descrever um estado no qual uma cultura totalitária se inculcou tanto nas pessoas de uma sociedade que um estado não é mais necessário para aplicá-la.

