O Nacional Transumanismo, freqüentemente chamado de Transumanismo Nazista e abreviado para NazH +, é uma bola de ideologia totalitária, culturalmente de extrema direita e economicamente (geralmente) de terceira posição. NazH +, embora ainda abraça o uso da tecnologia para melhorar o corpo humano, ao contrário de outros transhumanistas, prefere a Engenharia Genética como uma forma de levar a raça humana à divindade. Sua crença principal é "que sob as circunstâncias em que a Engenharia Genética se torna avançada o suficiente, todas as pessoas das raças inferiores escolherão que seus filhos se tornem da Raça Ária, uma vez que é a mais superior das raças." Esta fixação no aumento do genoma humano também tem o potencial de eliminar o racismo e o classismo, já que todos sob a "Guarda-chuva Ariana" encontrarão unidade sob uma nacionalidade.
Nazh + é a versão mais radical do Reactmod.png Modernismo Reacionário e leva os aspectos nietzschianos e eugenistas do Nacional-Socialismo ao que ele vê como seu extremo lógico.

