O anticentrismo quer acabar com o centrismo por qualquer meio, unificando todos os extremistas (ideologias fora da bússola política). Sua combinação de ideologias extremistas não se opõe, em vez disso, se somam em uma ideologia separada e mais extrema. Visto que ele foi feito e popularizado pelo Youtuber Jreg, ele é mais ou menos um substituto para ele e para o conteúdo coberto por seu canal às vezes também.
Tornado popular por Jreg na série de vídeos em seu canal chamada Centricide. Na série de vídeos, ele luta contra centristas da idade como Anrad.png Anti-Radicalism, Horshu.png Horseshoe Centrism e, claro, Radcent.png Radical Centrism. Ele se junta a extremistas como Nazbol.png National Bolshevism, Fash.png Fascism, Ancom.png Anarcho-Communism e Ancapf.png Anarcho-Capitalism.

