{{Ideologia |cortema = |cortexto = |titulo = |imagem = |legenda = |pseudonimos = |alinhamentos = |influenciado = |influenciou = |musica = |fundacao = |gosta = |desgosta = }}
E-Democracia é uma ideologia democrática que defende um sistema de governo destinado a aumentar a participação dos cidadãos por meio do uso da Internet. O E-Democracy se manifesta de muitas formas, Athdem.png A democracia ateniense é uma das mais comuns, em que todas as pessoas estão envolvidas na aprovação de leis. Isso é chamado de democracia eletrônica deliberativa. Uma alternativa, e-democracia consultiva, é onde os cidadãos usam fóruns para se envolver com o governo como um conselheiro.
[[en:E-Democracy]] [[ru:Электронная демократия]] [[pl:E-Demokracja]]

{{Ideologia |cortema = |cortexto = |titulo = |imagem = |legenda = |pseudonimos = |alinhamentos = |influenciado = |influenciou = |musica = |fundacao = |gosta = |desgosta = }}
O apolitismo é uma ideologia centrista cuja única característica definidora é a apatia ou antipatia pela política. O design e os maneirismos do personagem são uma referência a Eu Só Quero Grelhar pelo Amor de Deus, um meme que zomba da tendência apolítica dos baby boomers. Outras características derivadas do meme incluem o amor do apoliticismo por grelhar e o ódio ao racismo, tiroteios, socialismo e o KKK.
[[en:Apoliticsm]] [[pl:Apolityczność]] [[ru:Аполитизм]]

{{Ideologia |cortema = |cortexto = |titulo = |imagem = |legenda = |pseudonimos = |alinhamentos = |influenciado = |influenciou = |musica = |fundacao = |gosta = |desgosta = }}
O dengismo ou denguismo, oficialmente socialismo com características chinesas ou teoria de Deng Xiaoping, é uma ideologia autoritária, economicamente discutível (mas definitivamente pró-mercado, pelo menos no curto prazo), nacionalista e culturalmente mista. Dengismo viu que para que a China Cball-China.png se ajustasse às suas atuais condições econômicas, o capitalismo Cap.png, com influência partidária e investimento estrangeiro, teria que ser implementado para aumentar a produtividade. Teoricamente, isso eleva a China de seu estágio primário de socialismo a uma forma mais sofisticada de socialismo.
[[en:Dengism]]

