Centrismo Morto é uma bola que habita o centro exato Centrist-yellow.png da bússola política e é o mascote de Polcompball. Ele acredita que a melhor solução para todos os problemas é um compromisso exato entre dois extremos. Isso o leva a defender coisas consideradas muito extremas e malucas para um centrista, como gasear metade dos judeus como um meio-termo entre não gasear nenhum judeu e gasear todos eles.
