{{Ideologia |cortema = |cortexto = |titulo =[[File:Horshu.png]] Centrismo Ferradura |imagem =Ferradura.png |legenda =Bom, do jeito que eu vejo.... |pseudonimos =Reducionismo |alinhamentos = |influenciado = |influenciou = |musica = |fundacao = |gosta = |desgosta = }}
Centrismo Ferradura é uma ideologia política centrista, que acredita que quanto mais à direita você vai, mais perto você se aproxima da esquerda e vice-versa. Argumentando que as ideologias mais centristas como [[Arquivo:Socdem.png]] Social Democracia e [[Arquivo:Conserv.png]] Conservadorismo compartilham mais diferenças do que [[Arquivo:ML.png]] Marxismo-Leninismo com o [[Arquivo:Nazi.png]] Nacional-Socialismo, ele acredita que a extrema-direita e a extrema-esquerda são basicamente o mesmo.
